svg.script:
var svgDocument;
var svgDocument;
var xmlns="http://www.w3.org/2000/svg"
function startup(evt) {
	O=evt.target
	svgDocument=O.ownerDocument
	O.setAttribute("onmousedown","running=!running;offset()")
	grada = svgDocument.getElementById("flo");
	grada2= svgDocument.getElementById("vector_1");
	grada3= svgDocument.getElementById("vector_2");
	grada4= svgDocument.getElementById("vector_3");
	Corriente_a_plus=svgDocument.getElementById("g4909");
	Corriente_a_minus=svgDocument.getElementById("g4917");
	Corriente_r_plus=svgDocument.getElementById("i_r_plus");
	Corriente_r_minus=svgDocument.getElementById("i_r_minus");
	offset()
}
running=true
	limit=359
	blu=2
	incr=1
	rate=2
function offset(){
	if (!running) return

	onestep(rate)
	window.setTimeout("offset()",10)
}
function onestep(i){
	T="rotate("+blu+" 0 0)"
	T1="rotate("+(blu)+" 250 200)"
	T2="rotate("+(-blu)+" 250 200)"
	T3="scale("+ Math.cos(blu/360*2*3.14) + " "+  Math.cos(blu/360*2*3.14)  + ")  " + "translate(220, 200) "
	T4="translate(250, 200) scale("+Math.cos(blu/360*2*3.14)  + " " + Math.cos(blu/360*2*3.14)+" )"
	grada.setAttribute ("transform", T);
	grada2.setAttribute ("transform", T1);
	grada4.setAttribute ("transform", T2);
	grada3.setAttribute ("transform", T4);        
 	var red = Math.round(Math.cos(blu/360*2*3.14) * 255);
	var green = Math.round(0* 255);
	var blue = Math.round(-Math.cos(blu/360*2*3.14)  * 255);
        color_plus="rgb("+ red +","+ green+","+blue+")"
	color_minus="rgb("+ blue +","+ green+","+red+")"
	Corriente_a_plus.setAttribute("style","fill:"+color_plus);
 	Corriente_a_minus.setAttribute("style","fill:"+color_minus);
 	Corriente_r_plus.setAttribute("style","fill:"+color_plus);
 	Corriente_r_minus.setAttribute("style","fill:"+color_minus);	
	blu=blu+i
	if ((blu>limit)) blu=0
}
